    }

    if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!didSearchResultsLoad) {
        return <div>Loading...</div>;
      } else if(!quotes.length) {
        return <div>"No Quotes found." </div>
      }
        else {
        return (<div>

            { console.log(quotes) }

            <Container maxWidth="md" className="searchContainer"> 

            <Grid container direction="column" justify="center" spacing={3}>
            {/* <Grid item >
            <Quote id={quotes[0].QuoteId} minPrice={quotes[0].MinPrice} isDirect={quotes[0].Direct} />
            </Grid> */}
            {quotes.map( (elem) =>
                <Grid item style={{flexGrow: 1}}>
                        <Quote id={elem.QuoteId} 
                        minPrice={elem.MinPrice} 
                        isDirect={elem.Direct} 
                        airline={findCarriers(elem.OutboundLeg.CarrierIds)}
                        departureAirport="Baltimore Washington International (BWI)"
                        arrivalAirport="Washington Ronald Reagan (DCA)" />
                </Grid>
              )}

            </Grid>

            </Container>
            </div>
        );
      }


}

export default SearchResults;
